import { ArrowRightIcon } from "@heroicons/react/solid";
import React from "react";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <header className="bg-gray-800 md:sticky top-0 z-10 shadow-md">
      <div className="container mx-auto flex flex-wrap p-5 flex-col md:flex-row items-center">
        {/* Logo / Name */}
        <Link to="/" className="title-font font-medium text-purple-200 text-xl mb-4 md:mb-0 hover:text-white transition duration-300">
          Annie Rome
        </Link>

        {/* Navigation Links */}
        <nav className="md:ml-auto flex flex-wrap items-center text-purple-200">
          <Link to="/projects" className="mr-6 hover:text-white transition duration-300">
            Projects
          </Link>
          <Link to="/resume" className="mr-6 hover:text-white transition duration-300">
            Resume
          </Link>
        </nav>

        {/* Contact Me Button */}
        <a
          href="#contact"
          className="inline-flex items-center bg-purple-200 text-gray-800 border-0 py-2 px-4 rounded hover:bg-white hover:shadow-md transition duration-300 mt-4 md:mt-0"
        >
          Contact Me
          <ArrowRightIcon className="w-5 h-5 ml-2" />
        </a>
      </div>
    </header>
  );
}
